values:
&nbsp;So... tired....

I have not been sleeping. I even tried taking a nap today between classes and couldn't even manage to fall asleep for a moment.&nbsp;

I have been up past 4am/5am the past two nights. I think I might go insane soon..

&nbsp;Wow. New Year's eve was great. I ate way too much food. Though despite the fact that I had a large number of drinks, none of them had a high alcohol percentage, so&nbsp;I failed to even&nbsp;get a buzz... which was sad. I got to see my amazing friends Brianna and Samantha though. They are pretty much the coolest people ever. I love the random things they say and do. We had two barefoot snowball fights outside.. Lauren was apparently drunk as she was screaming out profanities, likely waking the neighbors. Then the second fight I told her she couldn't swear if she wanted to participate..&nbsp;so when we went outside&nbsp;she kept yelling, "I'm not swearing! I'm not swearing!" at the top of her lungs.. I don't think she really understood the point.&nbsp;
Anyway. As the ball was going down we all had some very sweet wine, which I actually enjoyed, but as I still don't care for wine, I gave half of my very full glass to Brianna, who can down anything in a half a second. (One time at IHOP she downed a mixture of salt/pepper/sugar/water... and a different concoction of the four different syrups they have on the table... it wasn't pretty... but it was impressive.)&nbsp;
I think we all went to bed around 1:30am. I was sleeping in the same room with Sam and Brianna though.. and we managed to stay up laughing and making prank calls until 5:30am. Quite an adventure. Ahh, these will be treasure memories..

&nbsp;Nick has been doing really well, really improving physically. He's muscled up and gained weight. He can do a regular 30 minute lesson without dying. He can go through turns without slowing down. He's going on the bit a lot easier and keeping it easier too. 
Despite all that he's still quite a literal pain. It seems every time I get on to ride lately he has to try to buck me off. I know he's got pain issues, and the cold doesn't help, but there's really no excuse. Well, at least he hasn't succeeded. The other thing is that he requires so much leg to get him going nicely forward and to keep him there, that a few hours after my ride my legs feel like they are on fire .. it's especially painful in the knee, and more with my right leg. It's freaking annoying, and every time it happens it doesn't go away til the next day and I can't sleep during the night because of it.&nbsp; 
Kathy was right today when she said that horse is damn lucky to have me. I love him though, I could never give him up. And I'm just so proud of the progress we've made together.. as slow as it may be.&nbsp; 
Well anyway, I just kind of had to rant a little. This is all probably going over most of your heads anyway.
